import React from "react";
import FASHIONIMG1 from "../../assets/img/fashion-img1.png";
import "./style.scss";

const fashions = [{ position: "left", title: "Parties", img: FASHIONIMG1 }];

const FashionItem = ({ position, title, img }) => {
  return (
    <div className="fahionitem">
      <div className="fashionitem-title">{title}</div>
      <img src={img} alt={position}></img>
    </div>
  );
};

const ChooseFashion = () => {
  return (
    <div className="choosefashion">
      <div className="choosefashion-title">
        <div className="choosefashion-container">
          <div className="choosefashion-title-tag"></div>
          <div className="choosefashion-title-content">
            Choose Fahionistas
            <span>
              1000+ <br></br> <p>TO HELO YOU IN</p>
            </span>
          </div>
        </div>
      </div>
      <FashionItem
        position="left"
        title="PARTIES"
        img={FASHIONIMG1}
      ></FashionItem>
    </div>
  );
};

export default ChooseFashion;
